import React, { useEffect, useState } from "react";
import NavbarPage from "../../user/components/navnew";
import "../../user/pages/history.css";
import Axios from "axios";
const Report = () => {
  const [report, setReport] = useState();
  const [showDropdown, SetshowDropdown] = useState(true);
  const Hiddendropdown = () => {
    SetshowDropdown(false);
  };
  const initReport = async () => {
    try {
      const Allreport = await Axios.get(
        "http://localhost:7000/post/report/non_verify"
      );
      setReport(Allreport.data.report);
      console.log(Allreport.data.report);
    } catch (err) {
      console.log("error");
    }
  };
  const ActiveVerify = () => {
    SetisActiveTop(true);
    SetisActiveButtom(false);
  };
  const ActiveNonVerify = () => {
    SetisActiveTop(true);
    SetisActiveButtom(false);
  };
  const Activehide = () => {
    SetisActiveTop(true);
    SetisActiveButtom(false);
  };
  useEffect(() => {
    initReport();
  }, []);

  return (
    <div onClick={() => Hiddendropdown()}>
      <NavbarPage
        SetshowDropdown={SetshowDropdown}
        showDropdown={showDropdown}
      />
      <h1 className="h1-contractus">รายงานโพสต์</h1>
      <div className="row">
      <div className="" onClick={()=>ActiveVerify()}>ตรวจสอบแล้ว</div>
      <div className="" onClick={()=>ActiveNonVerify()}>ยังไม่ตรวจสอบ</div>
      <div className="" onClick={()=>Activehide()}>ซ่อน</div>

      </div>
    </div>
  );
};

export default Report;
